	<body class="login no-js login-action-login wp-core-ui rtl  locale-ar">
	<script type="text/javascript">
		document.body.className = document.body.className.replace('no-js','js');
	</script>
		<div id="login">
		<h1><a href="https://ar.wordpress.org/">يعمل بواسطة برنامج ووردبريس</a></h1>
	
		<form name="loginform" id="loginform" action="http://https://ahmedmahmed222.github.io/test101/wp-login.php" method="post">
			<p>
				<label for="user_login">اسم المستخدم أو البريد الإلكتروني</label>
				<input type="text" name="log" id="user_login" class="input" value="" size="20" autocapitalize="off" />
			</p>

			<div class="user-pass-wrap">
				<label for="user_pass">كلمة المرور</label>
				<div class="wp-pwd">
					<input type="password" name="pwd" id="user_pass" class="input password-input" value="" size="20" />
					<button type="button" class="button button-secondary wp-hide-pw hide-if-no-js" data-toggle="0" aria-label="عرض كلمة المرور">
						<span class="dashicons dashicons-visibility" aria-hidden="true"></span>
					</button>
				</div>
			</div>
						<p class="forgetmenot"><input name="rememberme" type="checkbox" id="rememberme" value="forever"  /> <label for="rememberme">تذكرني</label></p>
			<p class="submit">
				<input type="submit" name="wp-submit" id="wp-submit" class="button button-primary button-large" value="دخول" />
									<input type="hidden" name="redirect_to" value="http://https://ahmedmahmed222.github.io/test101/wp-admin/" />
									<input type="hidden" name="testcookie" value="1" />
			</p>
		</form>

					<p id="nav">
								<a href="http://https://ahmedmahmed222.github.io/test101/wp-login.php?action=lostpassword">هل فقدت كلمة مرورك؟</a>
			</p>
					<script type="text/javascript">
			function wp_attempt_focus() {setTimeout( function() {try {d = document.getElementById( "user_login" );d.focus(); d.select();} catch( er ) {}}, 200);}
wp_attempt_focus();
if ( typeof wpOnload === 'function' ) { wpOnload() }		</script>
